<p>شاشة الهاتف المحمول 4.5 بوصة-6.8 بوصة (أو عرض الهاتف المحمول 6-9.5 سنتيمتر) جميع نظام أندرويد أو أبل مع الهواتف التي تدعم البلوتوث متوفرة. تعليمات الاستخدام: الخطوة 1: تشغيل زر التشغيل/الإيقاف الخطوة 2: اضغط على زر الاتصال بشكل متكرر ، وسيومض مؤشر شعار Bluetooth. الخطوة 3: في هذا الوقت ، قم بتشغيل مفتاح بلوتوث للهاتف المحمول والبحث عن جهاز البلوتوث. الاسم الافتراضي لحافظة لوحة المفاتيح هو لوحة مفاتيح بلوتوث 3.0. الخطوة 4: انقر فوق لوحة مفاتيح بلوتوث 3.0 على الجهاز اللوحي أو الهاتف المحمول. سيكون هناك كلمة مرور لأربعة أرقام عربية. أدخلها على لوحة المفاتيح ، على سبيل المثال ، موجه 1234 على الجهاز اللوحي. اضغط على لوحة المفاتيح واضغط على Enter للاتصال. معلمات لوحة المفاتيح: 1. يتوافق مع معيار البلوتوث 3.0 + HS ؛ بما في ذلك BQB ، FCC ، CE ، ROHS وغيرها من الشهادات ذات الصلة؛ 2. يمكن أن تصل مسافة الاستخدام إلى أكثر من 10 أمتار.3. طريقة التشكيل: 2.4 جيجاهرتز4. جهد التشغيل: 3.0-5 فولت5. تيار العمل &lt;4.0MA6. تيار الاستعداد 20UA7. تيار النوم &lt;2μA8. تيار شحن ≥ 100mA.9. وقت الانتظار 100 يومًا10. قوة الزر: 80 ± 10 جم11. يمكن أن تصل عمر الزر إلى 5 ملايين مرة.12. درجة حرارة التشغيل:-10-+ 55 درجة مئوية13. الرطوبة: 20%-50% </p>
